    var value = ''
    return (
        <div className='inputContainer'>
            <h1>URL <span>Shortener</span></h1>
            <div class="container">
                <input 
                type="input" 
                class="inputfield" 
                placeholder="Your URL" 
                value={value}
                onChange={value = value}
                />
                <button type="button" class="btn">Submit</button>
            </div>
        </div>
    )
}

export default InputURL
